import { Button } from 'reactstrap';
import React, { Component } from 'react';
import { MDBDataTable } from 'mdbreact';

class Users extends Component {

  constructor(props) {
  super(props)
  this.clickHandler = () => {
    //this.props.onClick();
    alert("Great Shot!");
  }

  this.data = {
    columns: [
      {
        label: 'Sr.No',
        field: 'srno',
        sort: 'asc',
        width: 150
      },
      {
        label: 'First Name',
        field: 'fname',
        sort: 'asc',
        width: 150
      },
      {
        label: 'Last Name',
        field: 'lname',
        sort: 'asc',
        width: 150
      },
      {
        label: 'Project',
        field: 'project',
        sort: 'asc',
        width: 200
      },
      {
        label: 'Skills',
        field: 'skills',
        sort: 'asc',
        width: 100
      },
      {
        label: 'Role',
        field: 'role',
        sort: 'asc',
        width: 150
      },

      {
        label: 'View',
        field: 'view',
        sort: 'asc',
        width: 150
      },

      {
        label: 'Update',
        field: 'edit',
        sort: 'asc',
        width: 150
      },

      {
        label: 'Delete',
        field: 'delete',
        sort: 'asc',
        width: 150
      },



    ],
    rows: [
      {
        srno:'1',
        fname: 'Tiger Nixon',
        lname: 'System Architect',
        project: 'Edinburgh',
        skills: 'HTML,AJAX,RESSCT',
        role: 'Employee',
        view: <Button onClick={this.clickHandler}>View</Button>,
        edit: <Button onClick={this.clickHandler}>Edit</Button>,
        delete: <Button onClick={this.clickHandler}>Delete</Button>
      },
       {
        srno:'2',
        fname: 'Tiger Nixon',
        lname: 'System Architect',
        project: 'Edinburgh',
        skills: 'JAVA',
        role: 'Admin',
        view: <Button onClick={this.clickHandler}>View</Button>,
        edit: <Button onClick={this.clickHandler}>Edit</Button>,
        delete: <Button onClick={this.clickHandler}>Delete</Button>
      },
       {
         srno:'3',
        fname: 'Tiger Nixon',
        lname: 'System Architect',
        project: 'Edinburgh',
        skills: 'PHP',
        role: 'Super',
        view: <Button onClick={this.clickHandler}>View</Button>,
        edit: <Button onClick={this.clickHandler}>Edit</Button>,
        delete: <Button onClick={this.clickHandler}>Delete</Button>
      },

    ]
  };

  }



  render() {
    return (
      <MDBDataTable
      striped
      hover
      data={this.data}
    />
    );
  }
}



export default Users;
